## 3. INSTRUÇÕES DE ÉTICA E CONDUTA

## 3.1 ANTISSUBORNO E ANTICORRUPÇÃO

Cumprimos as leis vigentes e acreditamos que as práticas de suborno e corrupção não são uma maneira justa de atuar no mercado, por isso não toleramos estas ações. Nossa empresa não ordena, autoriza, promete ou induz colaboradores e terceiros para realização de práticas corruptas, seja na esfera pública ou privada. Assim, a Gráfica JB:

- Não tolera qualquer violação de lei e regulamentos internos na condução de seus negócios ou atividades relacionadas;
- Coo pera integral e ativamente com órgãos reguladores e auditores independentes;
- Man tém e apoia normas e procedimentos destinados a salvaguardar a confidencialidade legítima das informações pertencentes aos seus clientes e profissionais conforme a Lei Geral de Proteção de Dados (LGPD - Lei n º 13.709/2018);
- Con duz seu negócio observando os princípios de concorrência.

## 3.2 DISCIPLINA E CONDUTA

- 5. Não saia das dependências da empresa com qualquer material que contenha  informações de clientes ou operações por eles realizadas;
- 6. Não copie, transcreva ou reproduza qualquer tipo de material com informações sobre clientes e parceiros;
- 7. Mant enha em segurança (trancados em gavetas ou protegidos em arquivos) documentos relacionados aos clientes e parceiros;
- 8. Ofer eça informações claras e verdadeiras, busque atender às expectativas dos nossos cliente s e às exigências legais.

## NÃO CONSIDERAMOS BRINDES OU GRATIFICAÇÕES:

Os itens abaixo são permitidos desde que não caracterizem conflito de interesse.

- Almoços, jantares, entretenimento e outros convites habituais, como eventos esportivos e de confraternização, no curso normal dos negócios com fornecedores de produtos ou prestadores de serviços e clientes, desde que em valores razoáveis;
- Brindes distribuídos por entidades de qualquer natureza a título de cortesia, propaganda, divulgação habitual ou por ocasião de eventos especiais ou datas comemorativas;
- A participação em seminários, congressos e eventos semelhantes;
- Os cola boradores que receberem presentes ou tratamentos especiais que não fizerem parte de cortesia normal deverão notificar imediatamente seu superior imediato, que deverá solicitar instruções à área de Marketing sobre o destino final de tais presentes.

